import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { HttpCallService } from 'src/services/http.service.';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css'],
})
export class NavbarComponent {
  constructor(public restApi: HttpCallService, private router: Router) {}

  toCatList() {
    this.router.navigate(['/cat-list']);
  }

  toUsList() {
    this.router.navigate(['/us-list']);
  }
}
<div class="navbar">
  <div>
    <button class="nav-button" (click)="toCatList()">Category</button>
    <button class="nav-button" (click)="toUsList()">User List</button>
  </div>
  <button class="logout-button" (click)="logoutAdmin()">Log Out</button>
</div>
